import React from "react";
import Navbar from "./Navbar";

function Home() {
  return (
    <React.Fragment>

      <div className="container-fuild">

        {/* background header for online courses */}
        <div className="showcase">

          {/* Navbar */}
            <Navbar />
        </div>
      </div>

    </React.Fragment>
  );
}

export default Home;
